import { createApp } from 'vue';
import App from './App.vue';
import { createPinia } from 'pinia';  // Import Pinia
import router from './router';  // Import Vue Router

const app = createApp(App);

// Dodajemo Pinia i Vue Router kao plugin
app.use(createPinia());
app.use(router);

app.mount('#app');
